import React from 'react';

const PredictionResult = ({ prediction, image }) => {
    return (
        <div>
            <h2>Predicted Breed:</h2>
            <p>{prediction}</p>
            {image && (
                <div>
                    <h2>Processed Image:</h2>
                    <img src={image} alt="Processed" style={{ maxWidth: '30px' }} />
                </div>
            )}
        </div>
    );
};

export default PredictionResult;
